import React from "react";

const HYInfo = (props) => {
  return (
    <div>
      <h2>姓名：{props.info.name}</h2>
      <h2>年龄：{props.info.age}</h2>
    </div>
  );
};

export default function MemoHookDemo02() {
  const info = { name: "Moxy", age: 18 };

  return (
    <div>
      <HYInfo info={info} />
    </div>
  );
}
